    [Fact]
    public async Task HandleAsyncTest()
    {
        var transactionId = "2000000970844641";
        var userIdA = Guid.NewGuid();
        await CreateAppStoreSubscriptionAsync(userIdA, transactionId);

        var userIdA1 = Guid.NewGuid();
        var responseDto = await CreateAppStoreSubscriptionAsync(userIdA1, transactionId);
        responseDto.ShouldNotBeNull();
        responseDto.Success.ShouldBeFalse();
        responseDto.Error.ShouldBe("Transaction verification failed: invalid user data");

        var json =
                "{\"signedPayload\":\"..4cYtMXJNM99lBEO_wB_UG3EC4r0ghsT4DIOZEUWg186wHnVbPPFWeEEwBH9jJttXC_IePaW8sDz0Qz-mHRTXdw\"}"
            ;
        var appleEventProcessingGrain =
            Cluster.GrainFactory.GetGrain<IAppleEventProcessingGrain>(AppleNotificationProcessorGrainId);
        var userIdB = await appleEventProcessingGrain.ParseEventAndGetUserIdAsync(json);
        userIdB.ShouldNotBe(default);
        // userIdB.ShouldBe(userIdA);

        var userBillingGAgent = Cluster.GrainFactory.GetGrain<IUserBillingGAgent>(userIdA);
        var result = await userBillingGAgent.HandleAppStoreNotificationAsync(userIdA, json);
        result.ShouldBeTrue();

        var paymentHistory = await userBillingGAgent.GetPaymentHistoryAsync();
        paymentHistory.ShouldNotBeNull();
        paymentHistory.Count.ShouldBe(2);
    }
    
